    ability_name    VARCHAR(74) NOT NULL,
    height          INTEGER  NOT NULL,
    weight          INTEGER  NOT NULL,
    generation      INTEGER  NOT NULL,
    evolutions      VARCHAR(473) NOT NULL
);

